🔸
Dirección :Steven Spielberg
Estreno : 15 de Diciembre de 1993
Género : Bélico, Drama 
Duración :195 minutos
Calificación : 9/10
🔸
Comentario : Principalmente quiero recalcar que el color y el sonido son fundamentales en esta producción. Siento que el blanco y negro en prácticamente toda la movie genera esa depresión instantánea al tratar temas tan delicados como la segunda guerra mundial.

Por otro lado, la banda sonora del maestro Williams es impresionante, una de las cosas que más me sorprende es la precisión con la que se utilizan los silencios en la peli.

El film nos lleva por un viaje a lo más profundo de la miseria humana, de manera cruda y realista. Esta peli es realmente necesaria a la hora de hablar sobre cine, siento que es una producción como pocas. 

Enserio es algo que todos deberían de ver, so go go go! 
